import React, { Component } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';

import CreateMemories from './components/CreateMemory';
import ShowMemoryList from './components/ShowMemoryList';
import ShowBookDetails from './components/ShowMemoriesDetails';
import UpdateBookInfo from './components/UpdateBookInfo';

class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <Route exact path='/' component={ShowMemoryList} />
          <Route path='/create-memories' component={CreateMemories} />
          <Route path='/edit-memories/:id' component={UpdateBookInfo} />
          <Route path='/show-memories/:id' component={ShowBookDetails} />
        </div>
      </Router>
    );
  }
}

export default App;
